import React, { Component } from 'react';
import './App.css';
import TasksList from './components/task-list';
import Header from './components/header';
class App extends Component {

  render() {
    var task ={
      id: 1,
      name :'don dep'
    };
    return (
      <div>
        <Header />
        <div className="row">
            <div className="col-6">
                <TasksList/>
            </div>
            <div className="col-6">
              <TasksList/>
            </div>
        </div>

        for(let data in task){
          <h3>
            {task[data]}
          </h3>
        }

      </div>

    );
  }
}

export default App;
